const JobOffer= () => {

  return (
    <section className="container">
      <h1 className="large text-primary">
        Add Your Job Offer
      </h1>
      <p className="lead">
        <i className="fas fa-graduation-cap"></i> Please don't Forget about  SocieteNamen,JobDescription,JobRequirements
  they are required !
      </p>
      <small>* = required field</small>
      <form className="form">
        <div className="form-group">
          <input
            type="text"
            placeholder="* SocieteName"
            name="SocieteName"
            // value={SocieteName}
            required
          />
        </div>
         <div className="form-group">
          <input
            type="text"
            placeholder=" adress"
            name="adress"
            // value={adress}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder=" recruteurName"
            name="recruteurName"
            // value={recruteurName}
            required
          />
          {/* lkkjfdvùihzbsd */}
        </div>
        <div className="form-group">
          <h4> Date</h4>
          <input type="date" name="date" />
        </div>
        {/* <div className="form-group">
          <p>
            <input type="checkbox" name="current" value="" /> Current School or Bootcamp
          </p>
        </div> */}
        {/* <div className="form-group">
          <h4>To Date</h4>
          <input type="date" name="to" />
        </div> */}
        <div class="form-group">
          <textarea
           name="JobDescription"
            cols="30"
           rows="5"
            placeholder="Your Job Description"
             // value={JobDescription}
          ></textarea>
        </div>
         <div class="form-group">
          <textarea
           name="JobBenefits"
            cols="30"
           rows="5"
            placeholder="Your job Benefits "
             // value={JobBenefits}
          ></textarea>
        </div>
         <div class="form-group">
          <textarea
           name="JobRequirements"
            cols="30"
           rows="5"
            placeholder="what your job requier"
            // value={obRequirements}
          ></textarea>
        </div>
         <div class="form-group">
          <textarea
           name="HowToApply"
            cols="30"
           rows="5"
            placeholder="How To Apply"
            // value={HowToApply}
          ></textarea>
        </div>
        <input type="submit" class="btn btn-primary my-1" />
        <a className="btn btn-light my-1" href="dashboard.html">Go Back</a>
      </form>
    </section>

  );
};

export default JobOffer;
